import React from 'react';

const Paginacao=({nextPageToken, previousPageToken, onNextPage, onPreviousPage})=>{
	return(
		<div>
			{(nextPageToken && !previousPageToken) ? (<button className= 'btn btn-default' onClick={()=> onNextPage(nextPageToken)} > Pr칩xima P치gina </button>): (null)	}
			{(nextPageToken && previousPageToken) ? (
				<div>
				<button className= 'btn btn-default' onClick={()=> onPreviousPage(previousPageToken)}> Voltar </button>	
				<button className= 'btn btn-default' onClick={()=> onNextPage(nextPageToken)}> Pr칩xima P치gina </button>
				</div> 
				):( null)} 
			{(!nextPageToken && previousPageToken) ? (<button className= 'btn btn-default' onClick={()=> onPreviousPage(previousPageToken)}> Voltar </button>): (null)	}
			
		</div>	
		);

} ;

export default Paginacao;
